    const dispatch = useDispatch

    const [productName, setProductName] = useState()

    return (
        <main>
            <form>
                <label>
                    <input
                        type='text'
                        placeholder='Name'
                        value={productName}
                        onChange={e => setProductName(e.target.value)}
                    >
                    name
                    </input>
                </label>
            </form>
        </main>
    )
}


export default CreateProduct
